import Home from "./Home";
import { BrowserRouter,Route, Router, Routes } from "react-router-dom";
import Cart from "./Cart";

const Path = ()=>{
    return(
<>

<BrowserRouter>
      <Routes>
      <Route path="/cart" element={<Cart/>}/>
      <Route path="/Home" element={<Home/>}/>
      </Routes>
      </BrowserRouter>
</>

    )
}
export default Path;
